ll we have a total of 182 observations with 35 parameters:\n","- **user_id**\n","- **Drinking_score**\n","- **Food_score**\n","- **physical_activity_frequency**: answers the question'How many times do you practice physical activity per week?'\n","- **physical_activity_time**: answers the question'At what time of the day do you usually practice physical activity?'\n","- **physical_activity_type**: answers the question 'Which physical activity do you practice? (More than one option can be chosen)'\n","- **Stress_score**\n","- **Anxiety_score**\n","- **Timestamp**\n","- **laptop_hours**\n","- **laptop_activities**: answers the question'What are the main activities you use your laptop for? (More than one option can be chosen)'\n","- **laptop_usage_before_sleep**: answers the question'Before going to sleep, when do you stop using your laptop?'\n","- **laptop_blue_light_filter**: answers the question 'Do you use the blue light filter on your laptop?\\n(Many laptops have a ‘Night Shift’ or ‘Night Mode’ feature that reduces blue light emission at night by changing the screen’s color temperature to a warmer hue, which can be found in the display settings and set to turn on automatically.)'\n","- **smartphone_hours**\n","- **smartphone_activities**: answers the question 'What are the main activities you use your smartphone for? (More than one option can be chosen)'\n","- **smartphone_usage_before_sleep**: answers the question'Before going to sleep, when do you stop using your smartphone?'\n","- **smartphone_blue_light_filter**: answers the question'Do you use the blue light filter on your smartphone?\\n(Many smartphones have a ‘Night Shift’ or ‘Night Mode’ feature that reduces blue light emission at night by changing the screen’s color temperature to a warmer hue, which can be found in the display settings and set to turn on automatically.)'\n","- **tv_hours**\n","- **tv_programs**: answers the question 'Which programmes do you tend to watch mostly? (More than one option can be chosen)'\n","- **tv_usage_before_sleep**: answers the question'Before going to sleep, when do you stop watching television?'\n","- **Screen_time_score**\n","- **go_to_sleep_time**: asnwers the question 'At what time do you usually go to bed?',\n","- **wake_up_time**: answers the question 'At what time do you usually wake up?',\n","- **dummy_nap**: answers the question 'Do you usually take a nap in the afternoon?',\n","- **nap_duration**: answers the question 'How long does your afternoon nap usually last?',\n","- **dummy_medicine_help_sleep**: answers the question 'Do you take any medicines to help you sleep?',\n","- **dummy_medicines_affect_sleep**: answers the question 'Do you take any medicines that may affect your sleep quality?'\n","- **Sleep_score**\n","- **BMI**: Body Mass Index,\n","- **birth_year**: year of birth,\n","- **birth_country**: country of birth,\n","- **current_employment**: current employement,\n","- **studies_type**: what kind of studies the user is pursuing\n"],"metadata":{"id":"kWwfJZciv7Gj"}},{"cell_type":"code","source":["# Join all previous tibbles\n","all_data <- left_join(nutrition_data_filtered, stress_anxiety_sport_data_filtered, by = \"user_id\")\n","all_data <- left_join(all_data, screen_time_data, by = \"user_id\")\n","all_data <- left_join(all_data, sleep_data_filtered, by = \"user_id\")\n","all_data <- left_join(all_data, socio_demo_data, by = \"user_id\")\n","\n","#Renaming columns/variables that need it\n","all_data <- all_data %>%\n","  rename(\n","    physical_activity_frequency = 'How many times do you practice physical activity per week?',\n","    physical_activity_time = 'At what time of the day do you usually practice physical activity?',\n","    physical_activity_type = 'Which physical activity do you practice? (More than one option can be chosen)',\n","    laptop_activities = 'What are the main activities you use your laptop for? (More than one option can be chosen)',\n","    laptop_usage_before_sleep = 'Before going 